import React, {Component} from "react";
import HeaderInterface from "../utils/HeaderInterface";
import MajFormation from "./MajFormation";
import MajUbUt from "./MajUbUt";

export default class MajAgriInterface extends Component{

    render(){
        return (
            <div className="AgriMAJ container-fluid">
                <HeaderInterface numeroTour={this.props.numeroTour} idPhase={"Mise à jour des biens"} pseudo={this.props.pseudo}/>
                <br/>
                <MajUbUt ut={this.props.ut} ub={this.props.ub} />
                <MajFormation formations={this.props.formations}/>
            </div>

        );
    }
}
